    public static boolean lemonadeChange(int[] bills) {
        int m = 0;
        int n = 0;
        int i = 0;
        while (m >= 0) {
            if (i == bills.length)
                return true;
            if (bills[i] == 5) {
                ++m;
            } else if (bills[i] == 10) {
                --m;
                ++n;
            } else {
                --m;
                --n;
            }

            if (n < 0) {
                m = m + 2 * n;
                n = 0;
            }
            ++i;
        }

        return false;
    }

